$(document).ready((function(){window.dataIndividu=[],window.dataTeam=[],window.dataMixTeam=[],window.dataOfficial=[];const a=$("#base_url").val(),n=$("#checkoutID").val();$.ajax({url:`${a}/get-data-form-order-tournament?checkoutID=${n}`,method:"GET",contentType:!1,success:function(a){const{data:n}=a;console.log("data:",n),window.dataIndividu=n.ticket_detail_individu_order,window.dataTeam=n.ticket_detail_team_order,window.dataMixTeam=n.ticket_detail_mix_team_order,window.dataOfficial=n.ticket_detail_official_order,generateViewIndividu(),generateViewTeam(),generateViewMixTeam(),generateViewOfficial()},error:function(a){console.log("error:",a.responseJson)}});const generateViewIndividu=()=>{const a=window.dataIndividu;if(a.length<1)return $("#individu_section").addClass("d-none");$("#individu_section").removeClass("d-none");const n=$("#individu_title_accordion").val();let i="";a?.map(((a,e)=>{console.log("val:",a),console.log("index:",e),i+=`\n        <div class="card">\n          <div class="card-header bg-primary-1 text-white text-left collapsed cursor-pointer"\n              id="participant_individu${e}"\n              data-toggle="collapse"\n              data-target="#collapse_participant_${e}"\n              aria-expanded="false"\n              aria-controls="collapse_participant_${e}">\n              ${n} ${e+1}\n          </div>\n          <div id="collapse_participant_${e}"\n              class='collapse ${0==e?"show":""}'\n              aria-labelledby="participant_individu${e}"\n              data-parent="#accordionParticipant">\n              <div class="card-body">\n                <div class="row">\n                  <div class="col-12 form-group">\n                      <label for="name_individu{{ $i }}">\n                          Full Name*\n                      </label>\n                      <input type="text" class="form-control" id="name_individu${e}" name="name_individu[]" placeholder="testing nama" required>\n                  </div>\n                </div>\n              </div>\n          </div>\n        </div>\n      `})),$("#form_individu").append(`\n      <div class="accordion" id="accordionParticipant">\n        ${i}\n      </div>\n    `)},generateViewTeam=()=>{const a=window.dataTeam;if(a.length<1)return $("#team_section").addClass("d-none");$("#team_section").removeClass("d-none"),a?.map(((a,n)=>{console.log("valTeam:",a),console.log("indexTeam:",n)}))},generateViewMixTeam=()=>{const a=window.dataMixTeam;if(a.length<1)return $("#mix_team_section").addClass("d-none");$("#mix_team_section").removeClass("d-none"),a?.map(((a,n)=>{console.log("valMix:",a),console.log("indexMix:",n)}))},generateViewOfficial=()=>{if(window.dataOfficial.length<1)return $("#official_section").addClass("d-none");$("#official_section").removeClass("d-none")}}));
